import React from 'react';
export default function RejectionListTable(props) {
  const { rejectionMessageList, deleteRejectionMessage, updateStatus, onEditFeedbackClick } = props;
  return (
    <div className="table-responsive">
      <table className="display dtable w-100">
        <thead>
          <tr>
            <th>S.No</th>
            <th>Message</th>
            <th>Status</th>
            <th>Edit</th>
            <th>Delete</th>
          </tr>
        </thead>
        <tbody>
          <RenderRow
            updateStatus={updateStatus}
            onEditFeedbackClick={onEditFeedbackClick}
            deleteRejectionMessage={deleteRejectionMessage}
            rejectionMessageList={rejectionMessageList} />
        </tbody>
      </table>
    </div>
  )
}

function RenderRow(props) {
  const { rejectionMessageList, deleteRejectionMessage, updateStatus, onEditFeedbackClick } = props;
  if (rejectionMessageList.length > 0) {
    return rejectionMessageList.map((data, index) => (
      <tr key={index}>
        <td>{index + 1}</td>
        <td>{data.message}</td>
        <td>
          <div
            onClick={(event) => updateStatus(data.status == "1" ? false : true, data.id)}
            className="custom-control custom-switch cursor_pointer">
            <input
              checked={data.status == "1" ? true : false}
              type="checkbox"
              className="custom-control-input cursor_pointer"
            />
            <label className="custom-control-label cursor_pointer" htmlFor="switch1" />
          </div>
        </td>
        <td>
          <button
            onClick={() => onEditFeedbackClick(data)}
            className="btn btn-action">
            <img src="/dms/images/edit.svg" alt="Edit" />
          </button>
        </td>
        <td>
          <button
            onClick={() => deleteRejectionMessage(data.id)}
            className="btn btn-action">
            <img src="/dms/images/delete.svg" alt="Delete" />
          </button>
        </td>
      </tr>
    ))
  }
  return (
    <tr>
      <td colSpan="7">No Data</td>
    </tr>
  )
}
